import { createTheme } from '@material-ui/core/styles';

const acBlue = "#3c5abe"
const acGray= "#707070"

export default createMuiTheme({
  palette: {
    common: {
      blue: `${acBlue}`,
      gray: `${acGray}`
    },
    primary: {
      main: `${acBlue}`
    },
    secondary: {
      main: `${acGray}`
    }
  },
  typography: {
    tab: {
      fontFamily: "Raleway",
      textTransform: "none",
      fontWeight: 700,
      fontSize: "1em",
    },
  }
})
